/** @format */

import React from "react";

const Input = ({setPlace}) => {
	return (
        <>
		<select
        placeholder ="Find"
			id='voice-select'
			style={{
				height: "30px",
				width: "100px",
				zIndex: "31111111",
				position: "absolute",
				top: "5vh",
                left: "50vw",
                borderRadius: "8px" ,
                outline:"none"
			}}
			class='form-control form-control-lg'>
			<option value='World' onClick={setPlace(0)}>World</option>
			<option value='India' onClick={setPlace(1)}>India</option>
			<option value='UK' onClick={setPlace(2)}>UK</option>
			<option value='USA' onClick={setPlace(3)}>USA</option>
        </select>
        </>
	);
};

export default Input;
